pragma solidity ^0.8.1.0;

contract Calculadora {
    //int public a;
    int public b;

    function suma(int _a,int _b) internal pure returns(int) {
        return (_a + _b);
    }

    function resta(int _a,int _b) internal pure returns(int) {
        return (_a - _b);
    }

    function multiplicacion(int _a,int _b) internal pure returns(int) {
        return (_a * _b);
    }

    function division(int _a,int _b) internal pure returns(int) {
        return (_a / _b);
    }

    function factorial(uint _a) internal pure returns(uint){
        if (_a <= 1){
            return 1;
        }
        else{
            return (_a * factorial(_a-1));
        }
    }

    function valorAbsoluto(int _a) internal pure returns(uint) {
        if (_a > 0){
            return(uint(_a));
        }
        else{
            return(uint(-_a));
        }
    }

    function cuadrado(int _a) internal pure returns(uint) {
        return uint(_a * _a);
    }


    function raizCuadrada(int128 x) internal pure returns(int128){
        require ( x>=0 );
        return int128 (raizCuadradaUnsigned(uint256(int256(x))));
    }



    function raizCuadradaUnsigned (uint256 x) internal pure returns(uint128) {
        require (x >= 0);
        if (x == 0) return 0;
        else {
            uint256 r = 1;
            // aplicamos algoritmo metodo babilonio en 5 iteraciones
            r = (r+x/r)/2;
            r = (r+x/r)/2;
            r = (r+x/r)/2;
            r = (r+x/r)/2;
            r = (r+x/r)/2;
            uint256 r1 = x/r;
            if (r < r1) return uint128(r);
            else{ 
                return uint128(r1);
            }
        }      
    }
}

